INSERT INTO public."Ciclos" (created_at, nombre, siglas, descripcion, id_ciclo) VALUES ('2025-03-11 11:55:24.763055+00', 'Desarrollo de Aplicaciones Web', 'DAW', 'El Grado Superior en Desarrollo de Aplicaciones Web es un título oficial de Formación Profesional perteneciente a la rama de Informática. La titulación, también conocida como DAW, está acreditada por el Ministerio de Educación.En esta FP conocerás la parte front end de la programación así como aspectos fundamentales de la parte back o ámbitos transversales como los sistemas informáticos o las bases de datos. ', '36cabd1e-c173-495d-94fc-51bfe6df800d');
INSERT INTO public."Ciclos" (created_at, nombre, siglas, descripcion, id_ciclo) VALUES ('2025-03-11 11:55:24.763055+00', 'Desarrollo de Aplicaciones Multiplataforma', 'DAM', 'DAM es una titulación oficial de grado superior que se encuentra dentro de la rama de FP Informática. Como Técnico Superior en Desarrollo de Aplicaciones Multiplataforma de Desarrollo de Aplicaciones Multiplataforma aprenderás todo lo que necesitas saber sobre sistemas informáticos, bases de datos y programación front y back end, adquiriendo así un aprendizaje más completo.', '5f032c9e-08f1-41de-bc4c-19a3ac2827fe');
INSERT INTO public."Ciclos" (created_at, nombre, siglas, descripcion, id_ciclo) VALUES ('2025-03-11 11:55:24.763055+00', 'Desarrollo de VideoJuegos y Realidad Virtual', 'CEVRV', 'La competencia general de este curso de especialización consiste en diseñar y desarrollar videojuegos para diferentes dispositivos y plataformas, garantizando la experiencia del usuario, utilizando herramientas de última generación que permitan actuar en todas las fases de su desarrollo, así como aplicaciones interactivas de realidad virtual y aumentada.', 'a906f924-b287-4acf-a170-f743152c2aa3');
INSERT INTO public."Ciclos" (created_at, nombre, siglas, descripcion, id_ciclo) VALUES ('2025-03-11 11:55:24.763055+00', 'Sistemas Microinformáticos y Redes', 'SMR', 'Sistemas Microinformáticos y Redes es una profesión que se centra en el diseño, implementación y mantenimiento de sistemas informáticos a pequeña escala, incluyendo redes de computadoras y la administración de hardware, software y servicios relacionados para garantizar su funcionamiento eficiente y seguro. La labor del Técnico SMR es importante porque gracias a ella se asegura la eficiencia y seguridad de los sistemas informáticos en empresas e instituciones.', '56951ab9-cc40-421b-84ce-730b167edbfe');
INSERT INTO public."Ciclos" (created_at, nombre, siglas, descripcion, id_ciclo) VALUES ('2025-03-11 11:55:24.763055+00', 'Administración de Sistemas Informáticos en Red', 'ASIR', 'El término Administración de Sistemas Informáticos en Red hace referencia a una profesión que implica gestionar, mantener y asegurar el correcto funcionamiento de los sistemas informáticos en una red. Además es el nombre que adquiere el Grado Superior de Formación Profesional (FP) donde los alumnos se convierten en técnicos profesionales. Es importante porque garantiza la disponibilidad, seguridad y eficiencia de los recursos tecnológicos, facilitando el flujo de información y el funcionamiento de las organizaciones.', '3eb505e1-d0d0-46eb-87bb-d4cbb7ff7833');
INSERT INTO public."Cursos" (created_at, centro, nombre, descripcion, anyo, id_curso) VALUES ('2025-05-16 07:38:55.283232+00', 'IES Poeta Paco Mollà (Petrer)', 'Curso 2025/2026', 'Curso de prueba para eliminar después.', '2025', '256d7f00-0efe-47d0-86c1-65dcb8cc58fa');
INSERT INTO public."Cursos" (created_at, centro, nombre, descripcion, anyo, id_curso) VALUES ('2025-05-10 07:34:50+00', 'IES Poeta Paco Mollà (Petrer)', 'Curso 2024/2025', 'Primer curso de Desarrollo de Aplicaciones Web', '2024', '15726b48-92d4-4741-9b10-70f5181416ce');
